import React from "react";

function HelloDiv(props) {
  return (
    <div>
      <h1>Hello! My name is {props.name}</h1>
      <h2>I like...</h2>
      <ul>
        <li>{props.likesOne}</li>
        <li>{props.likesTwo}</li>
        <li>{props.likesThree}</li>
      </ul>
    </div>
  )
}

export default HelloDiv;
